function frmCancelEdit(g,k,p,r,n,v){var w=jQuery(document.getElementById("frm_edit_"+g)),u=w.find("a"),l=u.html();u.hasClass("frm_ajax_edited")||(u=jQuery(document.getElementById(k+g)),u.children(".frm_forms").replaceWith(""),u.children(".frm_orig_content").fadeIn("slow").removeClass("frm_orig_content"));w.replaceWith('<a id="frm_edit_'+g+'" class="frm_edit_link '+v+'" href="javascript:frmEditEntry('+g+",'"+k+"',"+r+","+n+",'"+frmFrontForm.escapeHtml(l)+"','"+v+"')\">"+p+"</a>")}
function frmUpdateField(g,k,p,r,n){jQuery(document.getElementById("frm_update_field_"+g+"_"+k)).html('<span class="frm-loading-img"></span>');jQuery.ajax({type:"POST",url:frm_js.ajax_url,data:{action:"frm_entries_update_field_ajax",entry_id:g,field_id:k,value:p},success:function(){""===r.replace(/^\s+|\s+$/g,"")?jQuery(document.getElementById("frm_update_field_"+g+"_"+k+"_"+n)).fadeOut("slow"):jQuery(document.getElementById("frm_update_field_"+g+"_"+k+"_"+n)).replaceWith(r)}})}
function frmDeleteEntry(g,k){jQuery(document.getElementById("frm_delete_"+g)).replaceWith('<span class="frm-loading-img" id="frm_delete_'+g+'"></span>');jQuery.ajax({type:"POST",url:frm_js.ajax_url,data:{action:"frm_entries_destroy",entry:g,nonce:frm_js.nonce},success:function(p){"success"==p.replace(/^\s+|\s+$/g,"")?jQuery(document.getElementById(k+g)).fadeOut("slow"):jQuery(document.getElementById("frm_delete_"+g)).replaceWith(p)}})}
function frmOnSubmit(g){console.warn("DEPRECATED: function frmOnSubmit in v2.0 use frmFrontForm.submitForm");frmFrontForm.submitForm(g,this)}
function frm_resend_email(g,k){console.warn("DEPRECATED: function frm_resend_email in v2.0");$link=jQuery(document.getElementById("frm_resend_email"));$link.append('<span class="spinner" style="display:inline"></span>');jQuery.ajax({type:"POST",url:frm_js.ajax_url,data:{action:"frm_entries_send_email",entry_id:g,form_id:k},success:function(g){$link.replaceWith(g)}})};